import React from 'react';
import logo from './logo.svg';
//import './App.css';
import ListaAula from './component/ListaAula';
import FormAula from './component/FormAula';

const aulas = ["React #1", "React #2", "React #3", "React #4"];

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <h1>Apreendendo React JS</h1>
        <h1> Formul√°rio</h1>
        <FormAula></FormAula>

        <h1> Lista</h1>
        <ListaAula dados={aulas}></ListaAula>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Hello World
        </a>
      </header>
    </div>
  );
}

export default App;
